Use IRRIGACAO

-- Deletando os Municipios que nunca usaram
DELETE FROM Municípios WHERE NOT EXISTS(SELECT TOP 1 1 FROM Geral WHERE Municípios.[Seqüência do Município] = Geral.[Seqüência do Município]) AND NOT EXISTS(SELECT TOP 1 1 FROM [Nota Fiscal] WHERE Municípios.[Seqüência do Município] = [Nota Fiscal].[Município da Transportadora]) AND NOT EXISTS(SELECT TOP 1 1 FROM [Ordem de Serviço] WHERE Municípios.[Seqüência do Município] = [Ordem de Serviço].[Seqüência do Município]) AND NOT EXISTS(SELECT TOP 1 1 FROM Orçamento WHERE Municípios.[Seqüência do Município] = Orçamento.[Seqüência do Município]) AND NOT EXISTS(SELECT TOP 1 1 FROM Geral WHERE Municípios.[Seqüência do Município] = Geral.[Seqüência Município Cobrança]) AND NOT EXISTS(SELECT TOP 1 1 FROM Propriedades WHERE Municípios.[Seqüência do Município] = Propriedades.[Seqüência do Município]);

